import React , {useState} from 'react';





const Local=()=>{

    const[init,upda]=useState();
    const[subinit,subupda]=useState(init);


    const change=(e)=>{
       upda(e.target.value);
        }



    const sub=()=>{
        subupda(init);
        localStorage.getItem("data","jai singh rathore");
    }






    return(
        <>
        <h1>Local {subinit}</h1>      
        <input type="text" onChange={change}></input>
        <button onClick={sub}>Submit</button>
        </>
    );
}

export default Local;
